import React, { Component } from 'react';
import ComponentsSidebar from '../shared/ComponentsSidebar';

export class FichePatient extends Component {
    constructor(props) {
        super(props);
        this.state = {
            error: null,
            isLoaded: false,
            items: []
        };
    }

    componentDidMount() {
        fetch("https://localhost:8080/books")
            .then(res => res.json())
            .then(
                (result) => {
                    this.setState({
                        isLoaded: true,
                        items: result.items
                    });
                },
                // Note: it's important to handle errors here
                // instead of a catch() block so that we don't swallow
                // exceptions from actual bugs in components.
                (error) => {
                    this.setState({
                        isLoaded: true,
                        error
                    });
                }
            )
    }

    render() {
        const { error, isLoaded, items } = this.state;
        if (error) {
            return <div>Error: {error.message}</div>;
        } else if (!isLoaded) {
            return <div>Loading...</div>;
        } else {
            return (
                <div>
                    <div className="container d-flex p-md-0">
                        <ComponentsSidebar />
                        <h4>Tutorials List</h4>
                        <ul>
                            {items.map(item => (
                                <li key={item.id}>
                                    {item.name} {item.price}
                                </li>
                            ))}
                        </ul>
                    </div>{/* container */}
                </div >
            );
        }
    }
}

export default FichePatient;
